import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { AppDiscViewContainerComponent } from './app-disc-view.container';

@NgModule({
  declarations: [AppDiscViewContainerComponent],
  imports: [
    CommonModule,
    RouterModule.forChild([
      {
        path: 'app-disc-view',
        component: AppDiscViewContainerComponent
      }
    ])
  ]
})
export class AppDiscViewModule { }
